import axios from "axios";

export class RentService{

    baseUrl = "http://localhost:8080/api/v1/rent/"


    getRentEmail(email){
        return axios.get(this.baseUrl + email).then(res => res.data);
    }

    getRentId(id){
        return axios.get(this.baseUrl + "rented/" + id).then(res => res.data);
    }

    postCustomer(customer){
        return axios.post(this.baseUrl + "/create", customer).then(res => res.data);
    }
}
